CREATE TABLE IF NOT EXISTS members (
    `id` INT,
    `titulo` VARCHAR(15) CHARACTER SET utf8,
    `nome` VARCHAR(48) CHARACTER SET utf8,
    `email` VARCHAR(42) CHARACTER SET utf8,
    `igreja` VARCHAR(48) CHARACTER SET utf8,
    `dnas` DATETIME,
    `naturalde` VARCHAR(29) CHARACTER SET utf8,
    `rg` VARCHAR(26) CHARACTER SET utf8,
    `cpf` VARCHAR(14) CHARACTER SET utf8,
    `data_filiacao` DATETIME,
    `data_ordenacao` DATETIME,
    `obs` VARCHAR(172) CHARACTER SET utf8
);
